package main

import "sort"

func maximumScore(nums []int, k int) int {
    const mod = 1000000007
    n := len(nums)
    // Convert nums to pairs of (value, primeScore)
    pairs := make([][2]int, n)
    for i, num := range nums {
        pairs[i] = [2]int{num, primeScore(num)}
    }
    // Sort pairs by prime score then by value
    sort.Slice(pairs, func(i, j int) bool {
        if pairs[i][1] == pairs[j][1] {
            return pairs[i][0] > pairs[j][0]
        }
        return pairs[i][1] > pairs[j][1]
    })

    // Calculate maximum score
    score := 1
    for i := 0; i < k && i < n; i++ {
        score = int((int64(score) * int64(pairs[i][0])) % mod)
    }

    return score
}

func primeScore(x int) int {
    score := 0
    for d := 2; d*d <= x; d++ {
        if x%d == 0 {
            for x%d == 0 {
                x /= d
            }
            score++
        }
    }
    if x > 1 {
        score++
    }
    return score
}
